import styled from "styled-components";

export const Flex = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 20px;
  border-radius: 18px;
  font-size: 40px;
  font-style: italic;l
  margin-bottom: 80px;

  @media (max-width: 800px) {
    flex-direction: column;
    padding: 0;
  }
`;
